targets.query:
from(bucket: "rockoon")
  |> range(start: v.timeRangeStart, stop: v.timeRangeStop)
  |> filter(fn: (r) => r["_measurement"] == "tracker")
  |> filter(fn: (r) => r["_field"] == "latitude" or r["_field"] == "longitude" or r["_field"] == "gps altitude")
  |> pivot(rowKey:["_time"], columnKey: ["_field"], valueColumn: "_value")
  |> map(fn: (r) => ({
    TimeStamp: r._time,
    latitude: r.latitude,
    longitude: r.longitude,
    gpsaltitude: r["gps altitude"]
  }))
|> map(fn: (r) => ({
      r with
      latitude: float(v: r.latitude) / 10000.0,
      longitude: float(v: r.longitude) / 10000.0
    }))

